INSERT INTO `screenTechTestForDoctorsMasterQuestions` VALUES (1,NULL,'No','What does step 4 for an appointment mean?',NULL,NULL,'Yes','Select box','Appointment cancelled','Appointment rescheduled','Cancelled due to incomplete intake','Appointment approved by doc','None of the above',0,0,0,1,0),(2,NULL,'No','What will you tell scbrain to show a URL on the TV in your room?',NULL,NULL,'Yes','Select box','show url','cs','show on screen','show on tv','',0,1,0,0,0),(3,NULL,'No','What do I enter in Health Insurance Coverage under Service Type to get information on psychotherapy coverage?',NULL,NULL,'Yes','Select box','A6','D9','42','17','',1,0,0,0,0),(4,NULL,'No','What do I type in SC Brain inside EMR to see a list of the patients appointments?',NULL,NULL,'Yes','Select box','show appts','appt','list appt','appts','',0,0,0,1,0),(5,NULL,'No','Which of the following are reasons I can\'t lock a note?',NULL,NULL,'Yes','Select box','The appointment is labeled as stage 3','You first need to review ROS and MSE','The scheduled appointment time has not started','The patient does not have any goals listed','Both B and C',0,0,0,0,1),(6,NULL,'No','Which of the following can the common screen do?',NULL,NULL,'Yes','Select box','Bring up a website in the EMR and scroll through the site','Rate goals in real time','Click on links in a site to navigate to other pages','Go to the previous page by clicking \"back\" at the top of the screen in EMR','All of the above',0,0,0,0,1),(7,NULL,'No','How do you create a custom screen that you can assign to a patient?',NULL,NULL,'Yes','Select box','Click on the \"+\" next to the screens panel','Navigate to Master DB, find \"screens\" and select \"+\"','I ask Laura or Robert to do it for me','I upload the screen to the drive section and label it as file type \"screen\"','',0,1,0,0,0),(8,NULL,'No','If I find a resource I want to share with the SC Team, what should I do?',NULL,NULL,'Yes','Select box','Go to \"Wiki\" in EMR and add the information there','Upload document to Drive and inform your colleagues','Upload document to documents section in your user profile','Use Scan to EMR','',1,0,0,0,0),(9,NULL,'No','What are the different kinds of reports available to me on the EMR',NULL,NULL,'Yes','Select box','Payments, Users, Events','Payments, Users, Events, Activity','Payments, Users, Events, Activity, Claims, Reminder Effectiveness, Help Desk','Payments, User, Events, Claims, Help Desk','',0,0,1,0,0),(10,NULL,'No','To unlock an event I find the Event ID in the Event Details panel',NULL,NULL,'Yes','Select box','True','False','','','',0,1,0,0,0),(11,NULL,'No','According to the training manual, what is the expected release of the CBT module phone app?',NULL,NULL,'Yes','Select box','End of September, 2016','1st quarter, 2017','End of November, 2016','2nd quarter, 2017','None of the above',0,0,0,0,1),(12,NULL,'No','If you encounter a bug in the system, what should you do first, second and third?',NULL,NULL,'Yes','Select box','1. Clear your cache and reload the page. 2. Check for software updates. 3. Create a github issue.','1. Clear your cache and reload the page. 2. Tell Laura. 3.  Tell Vikas.','1. All I need to do is create a github issue.','All I need to do is tell Laura.','',1,0,0,0,0),(14,NULL,'No','In the manual, what are the 2 main kinds of EHR tabs?',NULL,NULL,'Yes','Select box','Reports and Users','Patients and Events','You\'re fooling me, there are 4 types!','Users and Events','',0,0,0,1,0),(15,NULL,'No','Which of the following is part of the EMR design language?',NULL,NULL,'Yes','Select box','Things in yellow are important','Things in yellow are unlocked','There is only 1 way to accomplish an objective','There are at least 2 ways to accomplish an objective','',0,0,1,0,0),(17,NULL,'No','If you wanted to add the self-harm description \"cut wrists\" 5 times, what would you type into SC Brain?',NULL,NULL,'Yes','Select box','sh cut wrists, 5','sh, cut wrists, 5','s h cut wrists, 5','s h, cut wrists, 5','',1,0,0,0,0),(22,NULL,'No','When you create an appointment through the appointment panel, the appointment is automatically locked',NULL,NULL,'Yes','Select box','True','False','','','',0,1,0,0,0),(23,NULL,'No','To show on ipad I need to....',NULL,NULL,'Yes','Select box','Be logged into MyHealth with my EMR doctor login.','Open \"Show on iPad\" tab in EMR','Select the patient name','Do all of the above.','',0,0,0,1,0),(25,NULL,'No','If a patient requests to stop receiving automated emails, how do you change their settings?',NULL,NULL,'Yes','Select box','The patient needs to change this in their \"MyHealth\" portal under settings','You can use the subscriptions panel in the patient\'s file to disable emails.','Use the User Preferences panel in the patient\'s file to disable emails.','Someone with administrator access needs to update the patient\'s settings','',0,1,0,0,0),(26,NULL,'No','Where is the button to show a PDF on the common screen?',NULL,NULL,'Yes','Select box','In the common screen panel','In the documents panel','On the PDF itself','In the Drive','',0,0,1,0,0),(27,NULL,'No','What does this icon mean?',_binary 'PNG\r\n\Z\n\0\0\0\rIHDR\0\0\0\'\0\0\0%\0\0\0k>\0\0\niCCPICC Profile\0\0HTSY\Z\\{鍖\ޤ\0RB  ,J(1\"e@A cA,XdPP\\{v\\\\\}\\ͽ\\0#r\02E!>\N@\,P\p3\\\0hn>hzg:]\\\W\2\0@\2\A+eB\dg\nai\\Ӝ4˭\?\g愅x <\0\ሒ\0 G,nRLC\B\D؅\\!\\|a\ҚNgeFxO~0\\4\; \'|CQ	YԕR\\173ž\s\\c\\ũ\9\\\g\\X2DZ_ rBW\\'\s9\Y9\H\r\!͋\!ҞE\\oLϘ\˙Wfr\|Q\~x	^Ҽ \\:_\.)L\?\G\\\n>l9N\\\	\0>1\0l\	2r4X)\\-\\'%g2XȩI`\\+K;\0\\\O\lAt|NHhp>\@\0\\s\^\EX5CO_0d\r(\r)v	/\~\n\ @6X6Pv=A\r8N&p\\\mp \\%$A8Q!eH҃L +	@^P\0ECqP$\\Zh3T@\P%T.C7.\4Bo\0\n&\4Xև\a&̂\0x9s\|x\\W\\F2|\%KxP$2E1Q T*%BGJQUzTu%AB}Bc\T4mvB\\\\*zt1]nD_E\C\\\0\Z\\ac0IlLS9\c>`X:\\0k\FcSk\\\l+;\\p\83.\e\\npp\qpݸa\G<	\{\c|ߍ$\ p\BC&L\Dgb1XF\'^#>\"#H\$\TF:IA\Z$}\"+\\ed1y(B\S\(1L\6J-\\n\	\U\L-Ó\ S!\(\-Z \'˒]!+[